commit_message:
provide item_type default value in __init__ function

Currently use class __init__ function provide default value.
class ListOpt(Opt):

    def __init__(self, name, item_type=types.String(),
                       bounds=None, **kwargs):

class List(ConfigType):

    def __init__(self, item_type=String(), bounds=False):
        super(List, self).__init__()

Change-Id: Ia6c056eeffcebe7919402a521726bb0254b42e8a
Closes-Bug: #1504080
